import React from 'react';

const Todos = (props: any): JSX.Element => {
  return (
    <div>
      <h1>Shopping List</h1>
      <ul>
        {props.item.map( item => <li>{item.product}</li>)}
      </ul>
    </div>
  )
}

export default Todos;
